var urlDataEntity = "//api.vtexcrm.com.br/energilux/dataentities/FC/";

var contact = {	
	bindEvents: function() {
		$('#ctl00_Conteudo_btnEnviar').click(function(){
			console.log('oi');
			$('#form-contact-us').submit();
		})

	  $(document).on('submit', '#form-contact-us', function(evt) {
	    evt && evt.preventDefault();

	    var errsCount = 0;
	    var fieldsEmpty = [];

	    $('.obr').each(function(){
	      if($(this).parent().parent().find('input[type="text"]').val() == ''){
	      	fieldsEmpty.push($(this).parent().text());
	      }

	      if($(this).parent().parent().find('textarea').length){
	      	if ($(this).parent().parent().find('textarea').val() == '') {
	      		fieldsEmpty.push($(this).parent().text());
	      	};
	      }
	    });

	    if (errsCount) {
	      alert('Os seguintes campos esto com erro: \n'+ fieldsEmpty.join('\n'));
	    };

	    contact.sendData();
	  });
	},
	sendData: function (){

	    var headers = {
	      'Accept': 'application/vnd.vtex.ds.v10+json',
	      'Content-Type': 'application/json',
	      'REST-Range': 'resources=0-10'
	    };

	    var data = {
	      'name': $('input[name="ctl00$Conteudo$txtRemetenteNome"]').val(),
	      'lastname': $('input[name="ctl00$Conteudo$txtRemetenteSobrenom"]').val(),
	      'email': $('input[name="ctl00$Conteudo$txtRemetenteEndereco"]').val(),
	      'telephone': $('input[name="ctl00$Conteudo$txtRemetenteTelefoneDDD"]').val()+$('input[name="ctl00$Conteudo$txtRemetenteTelefoneNum"]').val(),
	      'cellnumber': $('input[name="ctl00$Conteudo$txtRemetenteCelularDDD"]').val()+$('input[name="ctl00$Conteudo$txtRemetenteCelularNum"]').val(),
	      'typerequest': $('select[name="ctl00$Conteudo$drpRemetenteTipoSolicitacao"] option:selected').val(),
	      'message': $('#ctl00_Conteudo_txtComentario').val()
	    };

	    data = JSON.stringify(data);

	    $.ajax({
	        url: urlDataEntity + 'documents',
	        type: 'POST',
	        data: data,
	        dataType: 'json',
	        crossDomain: true,
	        headers: headers,
	        success: function(data){
	          if(data){
	            if (data.Id != '') {
	              alert('Sua mensagem foi enviada. Obrigado por entrar em contato conosco.');
	            };
	          }
	        },
	        error: function(jqXHR, textStatus, errorThrown){
	          if(jqXHR.responseText){
	            if ($.parseJSON(jqXHR.responseText)) {
	              alert($.parseJSON(jqXHR.responseText).Message);
	            };
	          }
	        }
	    });
	}
}                                      

