/* push-description-top 14 palavras*/	
$(document).ready(function() {
	
	$(".description-bottom").clone().appendTo(".push-description-top");

	$(".push-description-top").each(function() {

		var text = $(this).text();
		var carac = text.length;

		if (carac > 0) {
			var query = text.split(" ", 20);
			query.push('... <a href="#vejamais" class="scrollsuave">Veja mais!</a>');
			res = query.join(' ');
			$(this).html(res);
			$(".li-push-description-top").css({display:"block"});
		}

	});

	$(".description-bottom").each(function() {

		var text = $(this).text();
		var carac = text.length;

		if (carac <= 0) {
			$(".li-push-description-top").css({display:"none"});
		}

	});
	
});
/* push-description-top 14 palavras*/

/* scrollsuave */
$(document).ready(function() {
	
  var $doc = $('html, body');
	
  $('.scrollsuave').click(function() {
      $doc.animate({
          scrollTop: $( $.attr(this, 'href') ).offset().top
      }, 500);
      return false;
  });
	
});
